import  "../App.css";



function AddNote(props) {
    const [note, setNote] = useState
  return (
    <div>
      <form>
        <input type="text" name="title" placeholder="Title" />
        <p>
          <textarea
            name="note"
            id="note"
            placeholder="Take a note..."
            
          ></textarea>
        </p>
      </form>
    </div>
  );
}

export default AddNote;
